   454→                    {% if session.summary %}
   455→                    {{ session.summary }} •
   456→                    {% endif %}
   457→                    {{ session.id[:8] }}
   458→                </div>
   459→                <div class='session-link-meta'>
   460→                    {{ session.timestamp_range }} • {{ session.message_count }} messages
   461→                    {% if session.token_summary %}
   462→                    <br>{{ session.token_summary }}
   463→                    {% endif %}
   464→                </div>
   465→                {% if session.first_user_message %}
   466→                <pre class='session-preview' style='font-size: 0.75em; line-height: 1.3; padding-bottom: 0;'>
   467→                    {{- session.first_user_message[:500]|e -}}{% if session.first_user_message|length > 500 %}...{% endif %}
   468→                </pre>
   469→                {% endif %}
   470→            </a>
   471→            {% endfor %}
   472→        </div>
   473→    </div>
   474→    {% endif %}
   475→
   476→    {% for message in messages %}
   477→    {% if message.is_session_header %}
   478→    <div class="session-divider"></div>
   479→    <div id='session-{{ message.session_id }}' class='message session-header'>
   480→        <div class='header'>Session: {{ message.content_html }}</div>
   481→        {% if message.session_subtitle %}
   482→        <div class='session-subtitle' style='font-size: 0.9em; color: #666; margin-top: 4px;'>{{
   483→            message.session_subtitle }} ({{message.session_subtitle.session_id}})</div>
   484→        {% endif %}
   485→
   486→    </div>
   487→    {% else %}
   488→    <div class='message {{ message.css_class }}'>
   489→        <div class='header'>
   490→            <span>{% if message.css_class == 'user' %}🤷 {% elif message.css_class == 'assistant' %}🤖 {% elif
   491→                message.css_class == 'system' %}⚙️ {% elif message.css_class == 'tool_use' %}🛠️ {% elif
   492→                message.css_class == 'tool_result' %}🧰 {% elif message.css_class == 'thinking' %}💭 {% elif
   493→                message.css_class == 'image' %}🖼️ {% endif %}{{ message.display_type }}</span>
   494→            <div style='display: flex; flex-direction: column; align-items: flex-end; gap: 2px;'>
   495→                <span class='timestamp'>{{ message.formatted_timestamp }}</span>
   496→                {% if message.token_usage %}
   497→                <span class='token-usage' style='font-size: 0.75em; color: #888;'>{{ message.token_usage }}</span>
   498→                {% endif %}
   499→            </div>
   500→        </div>
   501→        <div class='content'>{{ message.content_html | safe }}</div>
   502→    </div>
   503→    {% endif %}
   504→    {% endfor %}
   505→
   506→    <button class="toggle-details" id="toggleDetails" title="Toggle all details">📋</button>
   507→    <a class="scroll-top" title="Scroll to top" href="#title">🔝</a>
   508→
   509→    <script>
   510→        document.addEventListener('DOMContentLoaded', function () {
   511→            const toggleButton = document.getElementById('toggleDetails');
   512→
   513→            function updateToggleButton() {
   514→                const allDetails = document.querySelectorAll('details.collapsible-details');
   515→                const openCount = document.querySelectorAll('details[open].collapsible-details').length;
   516→                const totalCount = allDetails.length;
   517→
   518→                if (totalCount === 0) {
   519→                    toggleButton.style.display = 'none';
   520→                    return;
   521→                }
   522→
   523→                // If more than half are open, show "close all" state, otherwise show "open all"
   524→                const mostlyOpen = openCount > totalCount / 2;
   525→                toggleButton.textContent = mostlyOpen ? '📦' : '🗃️';
   526→                toggleButton.title = mostlyOpen ? 'Close all details' : 'Open all details';
   527→            }
   528→
   529→            function toggleAllDetails() {
   530→                const allDetails = document.querySelectorAll('details.collapsible-details');
   531→                const openCount = document.querySelectorAll('details[open].collapsible-details').length;
   532→                const shouldOpen = openCount <= allDetails.length / 2;
   533→
   534→                allDetails.forEach(details => {
   535→                    if (shouldOpen) {
   536→                        details.setAttribute('open', '');
   537→                    } else {
   538→                        details.removeAttribute('open');
   539→                    }
   540→                });
   541→
   542→                updateToggleButton();
   543→            }
   544→
   545→            toggleButton.addEventListener('click', toggleAllDetails);
   546→
