   683→
   684→            // Toggle details functionality
   685→            function updateToggleButton() {
   686→                const allDetails = document.querySelectorAll('details.collapsible-details');
   687→                const openCount = document.querySelectorAll('details[open].collapsible-details').length;
   688→                const totalCount = allDetails.length;
   689→
   690→                if (totalCount === 0) {
   691→                    toggleButton.style.display = 'none';
   692→                    return;
   693→                }
   694→
   695→                // If more than half are open, show "close all" state, otherwise show "open all"
   696→                const mostlyOpen = openCount > totalCount / 2;
   697→                toggleButton.textContent = mostlyOpen ? '📦' : '🗃️';
   698→                toggleButton.title = mostlyOpen ? 'Close all details' : 'Open all details';
   699→            }
   700→
   701→            function toggleAllDetails() {
   702→                const allDetails = document.querySelectorAll('details.collapsible-details');
   703→                const openCount = document.querySelectorAll('details[open].collapsible-details').length;
   704→                const shouldOpen = openCount <= allDetails.length / 2;
   705→
   706→                allDetails.forEach(details => {
   707→                    if (shouldOpen) {
   708→                        details.setAttribute('open', '');
   709→                    } else {
   710→                        details.removeAttribute('open');
   711→                    }
   712→                });
   713→
   714→                updateToggleButton();
   715→            }
   716→
   717→            toggleButton.addEventListener('click', toggleAllDetails);
   718→
   719→            // Filter functionality
   720→            const messageTypes = ['user', 'assistant', 'system', 'tool_use', 'tool_result', 'thinking', 'image'];
   721→            
   722→            function showFilterModal() {
   723→                filterOverlay.style.display = 'flex';
   724→                document.body.style.overflow = 'hidden';
   725→            }
   726→
   727→            function hideFilterModal() {
   728→                filterOverlay.style.display = 'none';
   729→                document.body.style.overflow = 'auto';
   730→            }
   731→
   732→            function selectAllTypes() {
   733→                messageTypes.forEach(type => {
   734→                    const checkbox = document.getElementById(`filter-${type}`);
   735→                    if (checkbox) checkbox.checked = true;
   736→                });
   737→            }
   738→
   739→            function selectNoTypes() {
   740→                messageTypes.forEach(type => {
   741→                    const checkbox = document.getElementById(`filter-${type}`);
   742→                    if (checkbox) checkbox.checked = false;
   743→                });
   744→            }
   745→
   746→            function applyFilter() {
   747→                const selectedTypes = messageTypes.filter(type => {
   748→                    const checkbox = document.getElementById(`filter-${type}`);
   749→                    return checkbox && checkbox.checked;
   750→                });
   751→
   752→                // Show/hide messages based on selected types
   753→                const allMessages = document.querySelectorAll('.message:not(.session-header)');
   754→                allMessages.forEach(message => {
   755→                    const shouldShow = selectedTypes.some(type => message.classList.contains(type));
   756→                    if (shouldShow) {
   757→                        message.classList.remove('filtered-hidden');
   758→                    } else {
   759→                        message.classList.add('filtered-hidden');
   760→                    }
   761→                });
   762→
   763→                // Update filter button appearance to indicate active filtering
   764→                const allTypesSelected = selectedTypes.length === messageTypes.length;
   765→                filterButton.style.backgroundColor = allTypesSelected ? '#e8f4fd66' : '#fff3cd66';
   766→                filterButton.title = allTypesSelected ? 'Filter messages' : 'Filter messages (active)';
   767→
   768→                hideFilterModal();
   769→            }
   770→
   771→            // Event listeners
   772→            filterButton.addEventListener('click', showFilterModal);
   773→            selectAllButton.addEventListener('click', selectAllTypes);
   774→            selectNoneButton.addEventListener('click', selectNoTypes);
   775→            applyFilterButton.addEventListener('click', applyFilter);
   776→
   777→            // Close modal when clicking outside
   778→            filterOverlay.addEventListener('click', function(e) {
   779→                if (e.target === filterOverlay) {
   780→                    hideFilterModal();
   781→                }
   782→            });
   783→
   784→            // Close modal with Escape key
   785→            document.addEventListener('keydown', function(e) {
   786→                if (e.key === 'Escape' && filterOverlay.style.display === 'flex') {
   787→                    hideFilterModal();
   788→                }
   789→            });
   790→
   791→            // Make filter options clickable
   792→            messageTypes.forEach(type => {
   793→                const option = document.querySelector(`label[for="filter-${type}"]`);
   794→                if (option) {
   795→                    option.addEventListener('click', function(e) {
   796→                        e.preventDefault();
   797→                        const checkbox = document.getElementById(`filter-${type}`);
   798→                        if (checkbox) {
   799→                            checkbox.checked = !checkbox.checked;
   800→                        }
   801→                    });
   802→                }
   803→            });
   804→
   805→            // Initialize button state
   806→            updateToggleButton();
   807→        });
